import action from './actionTypes';

export const openTabWeekMonthAction = () => ({
    type: action.OPEN_TAB_WEEK_MONTH,
});

export const activeMonthWeekSwitchAction = () => {
    type: action.ACTIVE_MONTH_SWITCH
}
